import React, { useState } from "react";
import TransactionDetails from "./transactionDetails";
import "./tableRow.scss";

const TableRow = (props) => {
  const { property } = props;
  const {id, outcode, street, lrTransactions} = property
  const [showDetails, setShowDetails] = useState(false);

  return (
    <>
        <div
        className="tableRow"
        onClick={() => {
            setShowDetails(!showDetails);
        }}
        >
            <div className="tableRow__id rowInfo">{id}</div>
            <div className="tableRow__outcode rowInfo">{outcode}</div>
            <div className="tableRow__street rowInfo">{street}</div>
            <div className="tableRow__transactions rowInfo">
                {property.lrTransactions.length}
            </div>
        </div>
        <TransactionDetails transactions={lrTransactions} display={showDetails} />
    </>
  );
};

export default TableRow;
